Verenigd Koninkrijk
Drama
91 minuten

geregisseerd door Regan Hall
met Lenora Crichlow, Lily James en Bradley James

Wanneer de eigenzinnige Shania (Lenora Crichlow) de ambitieuze Lisa (Lily James) ontmoet, botsen hun twee werelden op de atletiekbaan met explosieve resultaten als gevolg. Als de twee meiden zich beiden willen kwalificeren voor het wereldkampioenschap atletiek, barst er een strijd los met een dramatische, hartverwarmende en inspirerende reis als gevolg.



Vertaald door Simply ReleaseS Toppers
Granny, Jolly, Watchman en Suurtje



